/*Table structure for table `peliculas` */

DROP TABLE IF EXISTS `peliculas`;

CREATE TABLE `peliculas` (
  `idPeliculas` int(11) NOT NULL AUTO_INCREMENT,
  `idGenero` int(11) NOT NULL,
  `tituloPelicula` varchar(100) DEFAULT NULL,
  `PaisPelicula` varchar(50) DEFAULT NULL,
  `duracionPelicula` varchar(10) DEFAULT NULL,
  `directorPelicula` varchar(50) DEFAULT NULL,
  `ActoresPelicula` text,
  `SinopsiPelicula` text,
  `StockPelicula` int(11) DEFAULT NULL,
  `peliculaImagen` longblob,
  PRIMARY KEY (`idPeliculas`),
  KEY `Peliculas_FKIndex1` (`idGenero`),
  CONSTRAINT `FK_peliculas_genero` FOREIGN KEY (`idGenero`) REFERENCES `genero` (`idGenero`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

