/* Procedure structure for procedure `spCargarEjemplar` */

/*!50003 DROP PROCEDURE IF EXISTS  `spCargarEjemplar` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spCargarEjemplar`(in idPeliculas int(11),in FormatoEjemplar varchar(8)
, in StockPelicula int(11), in CantidadAgregar int(11))
BEGIN
    declare cont int;
    set cont=0;
    While cont <CantidadAgregar do
	if FormatoEjemplar= "BLU-RAY" THEN 
	INSERT INTO ejemplar(idPeliculas, FormatoEjemplar, PrecioAlquilerEjemplar, EstadoEjemplar, PrecioVentaEjemplar) values 
	(idPeliculas, FormatoEjemplar, 20000, "LIBRE",60000);
	end if;
	if FormatoEjemplar= "DVD" THEN 
	INSERT INTO ejemplar(idPeliculas, FormatoEjemplar, PrecioAlquilerEjemplar, EstadoEjemplar, PrecioVentaEjemplar) VALUES 
	(idPeliculas, FormatoEjemplar, 15000, "LIBRE",45000);
	END IF;
	SET cont= cont+1;
     END WHILE;
     update peliculas set StockPelicula= StockPelicula+CantidadAgregar where idPeliculas= idPeliculas;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spcargarPelicula_Ejemplar` */

/*!50003 DROP PROCEDURE IF EXISTS  `spcargarPelicula_Ejemplar` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spcargarPelicula_Ejemplar`(in idPeliculas int(11),  in idGenero int(11),  in tituloPelicula varchar(100),
     in PaisPelicula varchar(50),  in duracionPelicula varchar(10),  in directorPelicula varchar(50),  in ActoresPelicula text,  in SinopsiPelicula text, in StockPelicula int(11),
     in peliculaImagen longblob , in cantidadDVD int(11), in cantidadBluray int(11))
BEGIN
     DECLARE contb INT;
      DECLARE contd INT;
      DECLARE suma INT;
    SET contd= 0;  
    SET contb=0;  
    set suma= cantidadDVD+cantidadBluray;
	if StockPelicula=suma then
		insert into peliculas(idPeliculas, idGenero, tituloPelicula, PaisPelicula, duracionPelicula, directorPelicula, ActoresPelicula,
		SinopsiPelicula, StockPelicula, peliculaImagen) values (idPeliculas, idGenero, tituloPelicula, PaisPelicula, duracionPelicula, directorPelicula, ActoresPelicula,
		SinopsiPelicula, StockPelicula, peliculaImagen);
	
			
			while contb < cantidadBluray do 
				insert into ejemplar(idPeliculas, FormatoEjemplar, PrecioAlquilerEjemplar, EstadoEjemplar, PrecioVentaEjemplar) values 
				(idPeliculas, "BLU-RAY", 20000, "LIBRE", 60000);
				SET contb= contb+1;
			END WHILE;
			
			WHILE contd < cantidadDVD DO 
				INSERT INTO ejemplar(idPeliculas, FormatoEjemplar, PrecioAlquilerEjemplar, EstadoEjemplar, PrecioVentaEjemplar) VALUES 
				(idPeliculas, "DVD", 15000, "LIBRE", 45000);
				SET contd= contd+1;
			END WHILE;
	end if;
			
    END */$$
DELIMITER ;

